import React from "react";
import { TrackType } from "../types/Types";

interface Props {
    data: TrackType
}

const Track:React.FC<Props> = ({data}) => {

    var trackData = data;

    return (<tr key={trackData.id}>
        <td>{trackData.id}</td>
        <td>{trackData.title}</td>
        <td>{trackData.artist}</td>
        <td>{trackData.genre}</td>
        <td>{trackData.bpm}</td>
        <td>
          {/* <button onClick={() => onDelete(song.id)}>Delete</button> */}
        </td>
      </tr>)
}

export default Track;
